pragma solidity ^0.5.12;
contract demo{
    
    mapping(address => uint) balances;
    
    address public receiver;
    
    constructor() public payable{
        receiver = msg.sender;
    }
    
    //充值 
    function recharge() public payable{
        balances[receiver] += msg.value;
        balances[msg.sender] -= msg.value;
        address(uint160(receiver)).transfer(msg.value);
    } 
    
    //提现  
    function withdraw(address _to) public payable{
        balances[_to] += msg.value;
        balances[receiver] -= msg.value;
        address(uint160(_to)).transfer(msg.value);
    } 
    
    //合约调用者钱包地址 
    function s1() public view returns(address){
       return msg.sender; 
    }
    
    //收款人钱包地址 
    function s2() public view returns(address){
       return receiver; 
    }
}
